import { Grid } from '@material-ui/core'
import React from 'react'


interface IProps{
    value: string
}

const HeaderCell: React.FC<IProps> = (props) =>{

    const {value} = props

    return(
        <Grid
            container
            justifyContent='center'>
                {value}
            </Grid>
            
    )
}

export default HeaderCell
